script: |
  super -f text -I q678.spq | sort > q678.out

inputs:
  - name: q678.spq
    data: |
      SELECT DISTINCT - - col0 - + col2 / 46 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col2 NOT BETWEEN NULL AND + - 66 * col0 + CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q678.out
    data: |
